import Counter from "./counter";
import { useState } from "react";

function Counters() {
  const [counters] = useState([
    { id: 1, value: 0 },
    { id: 2, value: 0 },
    { id: 3, value: 0 },
    { id: 4, value: 0 },
  ]);

  return (
    <div>
      {counters.map((counter) => (
        <Counter key={counter.id} value={counter.value} />
      ))}
    </div>
  );
}
export default Counters;
